import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import {Layout, Header, Navigation, Drawer, Content} from 'react-mdl';

class App extends Component {
  render() {
    return (
      <div className="demo-big-content">
        <Layout>
            <Header title="Revive" scroll>
                <Navigation>
                    <a href="#">Home</a>
                    <a href="#">About</a>
                    <a href="#">Contact</a>
                </Navigation>
            </Header>
            {/* <Drawer title="Title">
                <Navigation>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                </Navigation>
            </Drawer> */}
            <Content>
                <div className="page-content" />
                <div>
                  <h1>Resume Page</h1>
                </div>
            </Content>
        </Layout>
      </div>
    );
  }
}

export default App;
